import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todos, settodos] = useState('')
  useEffect( () => {
    axios.get('http://127.0.0.1:8000/todos', {
      headers: {
        'Access-Control-Allow-Origin': '*',
      }})
      .then(res => {
        console.log(res)
        settodos(res.data)
      })
      .catch(err => {
        console.log(err)
      },[])

  })
  return (
    <div className="App">
        {
         todos.map((data) => {
           <p>data</p>
         })
        }
    </div>
  );
}

export default App;
